import React, {useState} from "react";
import BasicCard, {Message} from './message'
import {User, generate_request} from "../models/User.components";
import Timer from "../Timer/timer";

let messages : Message[] = [];
const user: User = JSON.parse(localStorage.getItem("user")!);

function urlbuilder(propt: string) {
    return "localhost:8080/chat?prompt=" + propt;
}
const helloMessage :Message = {
    text:"Hello, how are you feeling today?"
}
export async function getResponse(prompt: string) {
    const text = generate_request(prompt, user);
    try {
        // ðŸ‘‡ï¸ const response: Response
        const response = await fetch(urlbuilder(text), {
            method: 'GET',
            headers: {
                Accept: 'application/json',
            },
        });

        if (!response.ok) {
            throw new Error(`Error! status: ${response.status}`);
        }

        // ðŸ‘‡ï¸ const result: GetUsersResponse
        const result = (await response.json()) as User;

        console.log('result is: ', JSON.stringify(result, null, 4));
        return result;
    } catch (error) {
        if (error instanceof Error) {
            console.log('error message: ', error.message);
            return error.message;
        } else {
            console.log('unexpected error: ', error);
            return 'An unexpected error occurred';
        }
    }
}

export default function Chat() {

    let messages1 = messages.length !=0 ? messages.map((message, index) => (
        BasicCard(message)
    )) : BasicCard(helloMessage);
    return(
        <div >
            {messages1}
        </div>
    );
}
